create database estatisticas;

use estatisticas;

create table renda_regiao(num_zona int (3), nome_zona varchar (50),
num_municipio int (2), nome_municipio varchar (50), num_distrito int (3),
nome_distrito varchar (50), class_01 bigint, class_02 bigint, class_03 bigint,
class_04 bigint, class_05 bigint, total_zona bigint);


select * from renda_regiao;

/* total por municipio */
select nome_municipio, sum(total_zona) as total_municipio from renda_regiao group by nome_municipio order by total_municipio;

/* total de renda até R$1908 por municipio*/
select nome_municipio, sum(class_01) as total_renda_1098 from renda_regiao group by nome_municipio order by total_renda_1098;

/*total de maiores rendas por municipio*/
select nome_municipio, sum(class_05) as total_maior_renda_municipio from renda_regiao group by nome_municipio order by total_maior_renda_municipio;

/*maiores rendas pro distrito*/
select nome_distirto, sum(class_05) as total_maior_renda_zona from renda_regiao group by nome_zona order by total_maior_renda_zona;

/*total de rendas de até R$1908 por distrito*/
select nome_distrito, sum(class_01) as total_menores_rendas_zona from renda_regiao group by nome_zona order by total_menores_rendas_zona;

/*total media de salario brasileiro*/
select nome_zona, sum(class_02) as total_media_salario_brasileiro from renda_regiao group by nome_zona order by total_media_salario_brasileiro;

/*vizualização geral do total por classe de renda por municipio*/
select nome_municipio, sum(class_01) as 'até R$1.908', sum(class_02) as 'R$1.908 até R$3.816', sum(class_03) as 'R$3.816 até R$7.632',
sum(class_04) as 'R$7.632 até R$11.448', sum(class_05) as '+R$11.448' from renda_regiao group by nome_municipio;

/*vizualização geral do total por classe de renda por distrito*/
select nome_distrito, sum(class_01) as 'até R$1.908', sum(class_02) as 'R$1.908 até R$3.816', sum(class_03) as 'R$3.816 até R$7.632',
sum(class_04) as 'R$7.632 até R$11.448', sum(class_05) as '+R$11.448' from renda_regiao group by nome_distrito;

/*Porcentagem de usuários no municipio de SP que ganham até R$1908/mes*/
select nome_municipio, sum(class_01) / sum(total_zona) * 100 as porcentagem from renda_regiao 
where nome_municipio = 'São Paulo';

/*Porcentagem de usuários no municipio de SP que ganham de R#1908 até R$3816/mes*/
select nome_municipio, sum(class_02) / sum(total_zona) * 100 as porcentagem from renda_regiao 
where nome_municipio = 'São Paulo';

select nome_municipio, sum(class_01) / sum(total_zona) * 100 as porcentagem from renda_regiao 
group by nome_municipio order by porcentagem;

